import React, { Component } from 'react'
import Table from 'react-bootstrap/Table';

class Track extends React.Component
{
    render() {        
        if ( !this.props.data ) {
            return('');
        }

        const MAX_AI_LEVEL = 110;
        const trackInfo = this.props.data;
        const targetLap = this.props.targetLap;

        var targetLevel = trackInfo.times.find( (el) => {
            lapTimeMs = DateTime.fromMillis(el);
            return targetLap > lapTimeMs;
        });

        console.log('Target level:', targetLevel);

        return (            
            <div>
                <h3>{ trackInfo.name }</h3>        
                <h4>Track times</h4>
                <div>
                <Table responsive>
                    <thead>
                        <tr>
                            <th>AI Level</th>
                            <th>Target time</th>
                        </tr>
                    </thead>
                    <tbody>
                    {                        
                        trackInfo.times == null ? '' : trackInfo.times.map( (time, i) => 
                            <tr>
                                <td>{MAX_AI_LEVEL - i}</td> 
                                <td>{time}</td> 
                            </tr>
                        )
                    }
                    </tbody>
                </Table>
                </div>
            </div>
        )
    }
}

export default Track;
